import React from "react";

const DetailsPage = () => {
  return (
    <div>
      <div className="detailspage-bg">
        <div class=" w-full h-44 sm:h-44 md:h-48 lg:h-52 xl:h-80 ">
          <img
            src="/assets/images/anime_bg.jpg"
            alt=""
            className="object-cover w-full h-full rounded-b-3xl"
          />
        </div>
        <div className="flex flex-col xl:flex-row text-white">
          <div class="w-full xl:w-2/3">
            <div class="grid  gap-4">
              <div class="grid-cols-2">01</div>
              <div class="grid-cols-2">02</div>
            </div>
          </div>
          <div class="w-full xl:w-1/3 px-4 border-l border-slate-500">test</div>
        </div>
      </div>
    </div>
  );
};

export default DetailsPage;
